export default (function(a,b,c,d,e,f){return {data:{k80So1jwaI:{data:{id:1508,attributes:{imdbId:"tt0170016",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWNiNTczNzEtMjQyZC00MjFmLTkzMDMtODk4ZGMyZmE0N2E4XkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"49%"},{Source:"Metacritic",Value:"46\u002F100"}],item_lang:{data:{id:2171,attributes:{title:e,plot:"Inside a snowflake exists the magical land of Whoville, wherein live the Whos, an almost-mutated sort of Munchkin-like people who all love Christmas. Just outside of their beloved town lives the Grinch (Jim Carrey), a nasty creature that hates Christmas and plans to steal it from the Whos, which he equally abhors. Little Cindy Lou Who (Taylor Momsen) decides to befriend the Grinch.",slug:"how-the-grinch-stole-christmas"}}},books:{data:[{id:7931,attributes:{title:"How the Grinch Stole Christmas! Read & Listen Edition",description:"“Every Who down in Who-ville liked Christmas a lot . . . but the Grinch, who lived just north of Who-ville, did NOT!” Not since “’Twas the night before Christmas” has the beginning of a Christmas tale been so instantly recognizable. No holiday season is complete without the Grinch, Max, Cindy-Lou, and all the residents of Who-ville, in this heartwarming story about the effects of the Christmas spirit on even the smallest and coldest of hearts. Like mistletoe, candy canes, and caroling, the Grinch is a mainstay of the holidays, and his story is the perfect gift for young and old. This Read & Listen edition contains audio narration.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ibw4DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:f,publisher:d,subtitle:a}},{id:7932,attributes:{title:"How the Grinch Stole Christmas!",description:"A retelling, based on the film version, in which the Grinch tries to stop Christmas from arriving in Who-ville by stealing all the presents and food.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YhAlBDNOeIQC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Louise Gikow",b],firstBook:c,published:"2000-01-01",publisher:d,subtitle:a}},{id:7933,attributes:{title:e,description:"Grow your heart three sizes and get in on all of the Grinch-mas cheer with this Christmas classic--the ultimate Dr. Seuss holiday book that no collection is complete without! Every Who down in Who-ville liked Christmas a lot . . . but the Grinch, who lived just north of Who-ville, did NOT! Not since \"'Twas the night before Christmas\" has the beginning of a Christmas tale been so instantly recognizable. This heartwarming story about the effects of the Christmas spirit will grow even the coldest and smallest of hearts. Like mistletoe, candy canes, and caroling, the Grinch is a mainstay of the holidays, and his story is the perfect gift for readers young and old. \"Irrepressible and irresistible.\" --Kirkus Reviews",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=arDxAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:f,publisher:"RH Childrens Books",subtitle:a}},{id:7934,attributes:{title:"How the Grinch Stole Christmas! Grow Your Heart Edition",description:"The Dr. Seuss holiday classic How the Grinch Stole Christmas is now a major motion picture from Illumination Presents - Dr. Seuss' The Grinch With the 3-D cover included in this special edition of the original How the Grinch Stole Christmas, you can actually SEE the Grinch change when he learns the true meaning of Christmas This eye-catching edition of Dr. Seuss's beloved holiday classic features a huge lenticular 3-D inset on the cover that when moved shows the Grinch's heart growing three sizes, and his frown turning into a smile Available for a limited time only, this is the perfect gift for Dr. Seuss fans of all ages--and a must-have for collectors. Whether in the hands of a child, or artfully displayed on a coffee table, this very special edition of How the Grinch Stole Christmas will bring huge smiles to the faces of all who see it And don't forget to celebrate Grinch-mas this Christmas season, the annual holiday tradition inspired by How the Grinch Stole Christmas that encourages readers to grow their hearts three sizes by doing good deeds",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NtkxDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2017-09-19",publisher:d,subtitle:"Grow Your Heart 3-D Cover Edition"}},{id:7935,attributes:{title:"Doctor Seuss' how the Grinch Stole Christmas",description:a,thumbnail:a,authors:[b],firstBook:c,published:"1999-01-01",publisher:a,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940974381}}("","Dr. Seuss",null,"Random House Books for Young Readers","How the Grinch Stole Christmas","2013-10-22"))